    false,nt"url": null,nt"notes": "Report of investigations on geophysical
    logging techniques in Delaware as a mean to identify and correlate Coastal Plain
    formations. Geophysical logging techniques have been used in Delaware for many years
    as a means of identification and correlation of Coastal Plain formations. Criteria
    for the recognition of those formations having distinctive types of logs are presented.
    Formation factors have been calculated using multiple-point resistivity logs, temperature
    logs, and ground-water quality data and range from 1.2 to 6.8 for various formations
    underlying the State. Formation factors in turn are used to estimate water quality
    in later test holes.",nt"license_title": null,nt"extras": [{ntt"key":
